(1,	3,	1,	'<p>My name is Tony and I\'m a developer at <a href=\"https://devdojo.com\" target=\"_blank\">https://devdojo.com</a> and I also work with an awesome company in PB called The Control Group: <a href=\"http://www.thecontrolgroup.com\" target=\"_blank\">http://www.thecontrolgroup.com</a></p>\n        <p>You can check me out on twitter at <a href=\"http://www.twitter.com/tnylea\" target=\"_blank\">http://www.twitter.com/tnylea</a></p>\n        <p>or you can subscribe to me on YouTube at <a href=\"http://www.youtube.com/devdojo\" target=\"_blank\">http://www.youtube.com/devdojo</a></p>',	'2016-08-18 14:27:56',	'2016-08-18 14:27:56',	0,	0,	0),
(5,	6,	1,	'<p>Hey!</p>\n        <p>Thanks again for checking out chatter. If you want to login with the default user you can login with the following credentials:</p>\n        <p><strong>email address</strong>: tony@hello.com</p>\n        <p><strong>password</strong>: password</p>\n        <p>You\'ll probably want to delete this user, but if for some reason you want to keep it... Go ahead :)</p>',	'2016-08-18 14:39:36',	'2016-08-18 14:39:36',	0,	0,	0),
(6,	7,	1,	'<p>If you would like to leave some feedback or have any issues be sure to visit the github page here: <a href=\"https://github.com/thedevdojo/chatter\" target=\"_blank\">https://github.com/thedevdojo/chatter</a>&nbsp;and I\'m sure I can help out.</p>\n        <p>Let\'s make this package the go to Laravel Forum package. Feel free to contribute and share your ideas :)</p>',	'2016-08-18 14:42:29',	'2016-08-18 14:42:29',	0,	0,	0),
(7,	8,	1,	'<p>This is just a random post to show you some of the formatting that you can do in the WYSIWYG editor. You can make your text <strong>bold</strong>, <em>italic</em>, or <span style=\"text-decoration: underline;\">underlined</span>.</p>\n        <p style=\"text-align: center;\">Additionally, you can center align text.</p>\n        <p style=\"text-align: right;\">You can align the text to the right!</p>\n        <p>Or by default it will be aligned to the left.</p>\n        <ul>\n        <li>We can also</li>\n        <li>add a bulleted</li>\n        <li>list</li>\n        </ul>\n        <ol>\n        <li><span style=\"line-height: 1.6;\">or we can</span></li>\n        <li><span style=\"line-height: 1.6;\">add a numbered list</span></li>\n        </ol>\n        <p style=\"padding-left: 30px;\"><span style=\"line-height: 1.6;\">We can choose to indent our text</span></p>\n        <p><span style=\"line-height: 1.6;\">Post links: <a href=\"https://devdojo.com\" target=\"_blank\">https://devdojo.com</a></span></p>\n        <p><span style=\"line-height: 1.6;\">and add images:</span></p>\n        <p><span style=\"line-height: 1.6;\"><img src=\"https://media.giphy.com/media/o0vwzuFwCGAFO/giphy.gif\" alt=\"\" width=\"300\" height=\"300\" /></span></p>',	'2016-08-18 14:46:38',	'2016-08-18 14:46:38',	0,	0,	0),
(8,	8,	1,	'<p>Haha :) Cats!</p>\n        <p><img src=\"https://media.giphy.com/media/5Vy3WpDbXXMze/giphy.gif\" alt=\"\" width=\"250\" height=\"141\" /></p>\n        <p><img src=\"https://media.giphy.com/media/XNdoIMwndQfqE/200.gif\" alt=\"\" width=\"200\" height=\"200\" /></p>',	'2016-08-18 14:55:42',	'2016-08-18 15:45:13',	0,	0,	0),
(9,	9,	1,	'<p>Hey There!</p>\n        <p>My name is Tony and I\'m the creator of this package that you\'ve just installed. Thanks for checking out it out and if you have any questions or want to contribute be sure to checkout the repo here: <a href=\"https://github.com/thedevdojo/chatter\" target=\"_blank\">https://github.com/thedevdojo/chatter</a></p>\n        <p>Happy programming!</p>',	'2016-08-18 14:59:37',	'2016-08-18 14:59:37',	0,	0,	0),
(10,	9,	1,	'<p>Hell yeah Bro Sauce!</p>\n        <p><img src=\"https://media.giphy.com/media/j5QcmXoFWl4Q0/giphy.gif\" alt=\"\" width=\"366\" height=\"229\" /></p>',	'2016-08-18 15:01:25',	'2016-08-18 15:01:25',	0,	0,	0),
(11,	6,	1,	'<p>Hi there!</p>\r\n<p>&nbsp;</p>\r\n<p style=\"box-sizing: border-box; -webkit-font-smoothing: antialiased; margin: 0px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 20px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; vertical-align: baseline; color: #151a1f; letter-spacing: 0.5px;\">Hey!</p>\r\n<p style=\"box-sizing: border-box; -webkit-font-smoothing: antialiased; margin: 0px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 20px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; vertical-align: baseline; color: #151a1f; letter-spacing: 0.5px;\">Thanks again for checking out chatter. If you want to login with the default user you can login with the following credentials:</p>',	'2017-06-28 00:21:58',	'2017-06-28 00:21:58',	0,	0,	0),
