(15,	130,	'He was very excited! <a href=\"#\" class=\"stamp-link\" data-target=\"23\">@0:23</a>  ',	1,	'2016-10-21 22:15:01',	'2016-10-21 22:15:01',	'user',	NULL,	NULL),
(17,	88,	'Thank you for sharing the article! I think this is a great resource to share with our teachers. Often times, I think teachers face many barriers to asking great questions. I think especially for those working with infants and toddlers, we are worried about asking questions that are over the children\'s heads or that the experiences will lead to questions that the teachers themselves cannot answer. Although this is a great moment to engage in parallel learning with the children, the teachers may not like how vulnerable they feel in that moment. I really enjoyed the section on how and why questions. This is something that this initiative has helped me to think about in terms of moving my teachers away from just \'what the children know\' but also to helping the children explain how or why they came to that conclusion. I think the article gives some effective strategies to consider when using this line of questions. Lastly, I found it helpful to have more information than simply saying, \'use more open-ended questions\' with children. Although our teachers know what this means, it can be hard to come up with different questions. The examples listed are very tangible and could really assist our teachers with helping the children deepen their learning.\nMaegan',	1,	'2016-11-18 00:53:40',	'2016-11-18 00:53:40',	NULL,	NULL,	NULL),
(18,	47,	'I agree with Maegan.  I found it really interesting the way the article broke down the types of questions.  As I read these, it made me think of very specific teachers that I could share the different \"types\" of questions with.  I think that teachers sometimes get so caught up in trying to ask open-ended questions that they tend to not ask any questions at all. I believe that sharing this article will help them to think more about effective questions.  ',	1,	'2016-11-21 20:45:41',	'2016-11-21 20:45:41',	NULL,	NULL,	NULL),
(19,	88,	'This is Sommer.....having issues with getting logged into the website so I am logged in as Maegan.\nThis article really made me think about different types of questions we can be asking children. I can see teachers utilizing this article for more stimulating ways to ask questions that “asks children to show rather than answer the question.” Instead of predictable answers, these questions can bring out fresh insights and ideas, opening minds and enabling teachers and children to build knowledge together. I can see myself sharing this article with my teachers to deepen their understanding of asking questions.',	1,	'2016-11-29 20:26:03',	'2016-11-29 20:26:03',	NULL,	NULL,	NULL),
(20,	6,	'I enjoyed this article also and agree with all the comments posted so far.  This article made me think that the asking of questions by adults to children needs to be a mindful, intentional action if it is going to promote children\'s thinking and reasoning skills.  Closed-ended questions or \"impossible-to-answer\" questions just shut children down and often stop the play/exploration/experimenting that was occurring before the dreaded question was asked.  Teachers have the best intentions, as do parents, but what they don\'t realize is that asking quiz type questions doesn\'t result in the child learning anything; it seems to make US feel better, that we\'re \"teaching\" and doing our job.  The types of questions described in the article seem to follow a progression, maybe even somewhat a developmental progression if we think about infants, toddlers, preschoolers, and beyond.  The attention-focusing questions occur while children are exploring and getting to know materials, a step that has to happen according to the author before more complex explorations and questions can even make sense.  That makes sense to me!  My favorite sentence in the article is about when children ask questions: \"When children ask, they indicate that they want to know, and when they want to know, they are interested.\"  Maybe this is where it all has to start, with the child \"asking\" a question, whether verbally or non-verbally.  ',	1,	'2016-11-29 20:49:33',	'2016-11-29 20:49:33',	NULL,	NULL,	NULL),
(21,	133,	'When I first started reading the article, I was thrown off by the comment that wrong questions begin with things such as why, how or what.  It was interesting to continue reading and see that questions that typically begin with those words tend to cause anxiety in others because they may not have the “correct” answer to give.  To then go further with simply adding, “Why do you think…” makes such huge sense!  The children are then able to identify what their reasoning is without having to worry about whether they are right or wrong about the question.  I love that we are able to also share this with infant and toddler teachers.  If our young infant and toddler children are exposed to this language and line of reasoning and encouraging of thought provocations at earlier ages, it will be amazing to see what they are then able to do once they get to preschool and can fully verbalize their reasoning and explanations.  This was a great article that really helps define questions and how we can further children’s learning and exploration.',	1,	'2016-12-01 01:00:08',	'2016-12-01 01:00:08',	NULL,	NULL,	NULL),
(22,	1,	'hi',	1,	'2016-12-05 16:23:04',	'2016-12-05 16:23:04',	NULL,	NULL,	NULL),
(23,	47,	'As I sat and watched in my classrooms, I found myself really listening for those questions.  In one classroom, the teachers were asking questions \"all the time.\"  When a child would say, \"I wore my new coat today.\"  Instead of just saying, \"I like your new coat.\"  The teacher said, \"I see you have a new coat.  I wore a coat today too.  I wonder why we both wore coats.\"  The teacher and child went on to have a back and forth exchange about the cold and wearing coats.  \nIn another room, a child was trying to get a tower to stand up, but it kept falling as they put the fourth block on.  The teacher watched this several times.  Instead of just telling the child the block on the bottom was too small, she stated a wondering, \"Hmm, I wonder why that tower keeps falling?  What could we try to make it stand up?\"  Two other children joined in and they had a rich discussion about different things to try.  When they came upon a solution, putting a bigger block on the bottom, the teacher stated the question and solution for the children.  Who were very pleased with the fact that they were able to figure it out together.  \nRight now, all three of my preschool rooms are very interested in the weather.  There is a great deal of discussion about cold and when it might snow.  And, of course, all the things they will do in the snow once it comes.  My toddler room is quite interested in water right now.  They are exploring putting water in different sized containers and also putting water outside and talking about stability and change.  \n',	1,	'2016-12-14 02:26:08',	'2016-12-14 02:26:08',	NULL,	NULL,	NULL),
(24,	1,	'Hi Michelle!\nIt sounds like your teachers and children are doing some great thinking, wondering, and exploring. Your examples nicely show how a teachers\' questions prompt children\'s actions. It seems like you observed \"how\", \"why\", and \"problem posing\" types of questions. I wonder if, after posing such open ended questions teachers also asked other types of questions (e.g., comparison questions, action questions) to scaffold children\'s thinking about their answers to those questions. For example, in working with the tower, did teachers ask, \"which one is bigger?\", or \"what happens if we put the larger block on the bottom?\"\n\n\n\n\n',	1,	'2016-12-15 01:06:48',	'2016-12-15 01:06:48',	NULL,	NULL,	NULL),
