(17,	'Lyrics to Changer',	'<p>[Couplet 1]<br />\r\nMon ami, mon avenir, ma vie, pardonne-moi<br />\r\n<a annotation-fragment=\"1784820\" classification=\"accepted\" data-id=\"1784820\" href=\"https://genius.com/Maitre-gims-changer-lyrics#note-1784820\" image=\"false\" ng-class=\"{          \'referent--linked_to_preview\': song_ctrl.referent_has_preview(fragment_id),          \'referent--linked_to_preview_active\': song_ctrl.highlight_preview_referent(fragment_element_id),          \'referent--purple_indicator\': song_ctrl.show_preview_referent_indicator(fragment_element_id)        }\" ng-click=\"open()\" on-hover-with-no-digest=\"set_current_hover_and_digest(hover ? fragment_id : undefined)\" pending-editorial-actions-count=\"0\" possibly-branded=\"false\" prevent-default-click=\"\">Ce visage inexpressif rempli de tristesse</a><br />\r\n<a annotation-fragment=\"1788041\" classification=\"accepted\" data-id=\"1788041\" href=\"https://genius.com/Maitre-gims-changer-lyrics#note-1788041\" image=\"false\" ng-class=\"{          \'referent--linked_to_preview\': song_ctrl.referent_has_preview(fragment_id),          \'referent--linked_to_preview_active\': song_ctrl.highlight_preview_referent(fragment_element_id),          \'referent--purple_indicator\': song_ctrl.show_preview_referent_indicator(fragment_element_id)        }\" ng-click=\"open()\" on-hover-with-no-digest=\"set_current_hover_and_digest(hover ? fragment_id : undefined)\" pending-editorial-actions-count=\"0\" possibly-branded=\"false\" prevent-default-click=\"\">De nombreuses fois j&#39;ai d&ucirc; te mentir<br />\r\nOu me mettre dans la peau d&#39;un autre<br />\r\nDes kilom&egrave;tres entre la parole et l&#39;acte<br />\r\nT&#39;as fini par voir mon petit jeu d&#39;acteur</a><br />\r\n<br />\r\n[Refrain]<br />\r\nMais laisse-moi, j&#39;peux tout t&#39;expliquer<br />\r\nDes fois j&#39;fais des choses que j&#39;comprends pas<br />\r\n<a annotation-fragment=\"1784885\" classification=\"accepted\" data-id=\"1784885\" href=\"https://genius.com/Maitre-gims-changer-lyrics#note-1784885\" image=\"false\" ng-class=\"{          \'referent--linked_to_preview\': song_ctrl.referent_has_preview(fragment_id),          \'referent--linked_to_preview_active\': song_ctrl.highlight_preview_referent(fragment_element_id),          \'referent--purple_indicator\': song_ctrl.show_preview_referent_indicator(fragment_element_id)        }\" ng-click=\"open()\" on-hover-with-no-digest=\"set_current_hover_and_digest(hover ? fragment_id : undefined)\" pending-editorial-actions-count=\"1\" possibly-branded=\"false\" prevent-default-click=\"\">La nuit m&#39;aide &agrave; m&eacute;diter</a><br />\r\n<a annotation-fragment=\"1788054\" classification=\"accepted\" data-id=\"1788054\" href=\"https://genius.com/Maitre-gims-changer-lyrics#note-1788054\" image=\"false\" ng-class=\"{          \'referent--linked_to_preview\': song_ctrl.referent_has_preview(fragment_id),          \'referent--linked_to_preview_active\': song_ctrl.highlight_preview_referent(fragment_element_id),          \'referent--purple_indicator\': song_ctrl.show_preview_referent_indicator(fragment_element_id)        }\" ng-click=\"open()\" on-hover-with-no-digest=\"set_current_hover_and_digest(hover ? fragment_id : undefined)\" pending-editorial-actions-count=\"0\" possibly-branded=\"false\" prevent-default-click=\"\">C&#39;est dans ces moments que j&#39;me dis que j&#39;vais changer<br />\r\nJ&#39;vais changer</a><br />\r\n<br />\r\n[Couplet 2]<br />\r\nMes ennuis, mes envies<br />\r\nMes d&eacute;sirs, mes plaisirs<br />\r\nOnt pris le dessus sur ma vie d&#39;famille<br />\r\nJusqu&#39;&agrave; m&#39;en d&eacute;tourner<br />\r\nL&#39;argent d&eacute;truit le c&oelig;ur d&#39;autrui<br />\r\nJe n&#39;peux dissocier l&#39;ennemi de l&#39;ami<br />\r\nTant pis je n&#39;veux pas d&#39;leur empire<br />\r\nJe pr&eacute;f&egrave;re ton sourire dans un trou d&#39;souris<br />\r\n<br />\r\n[Refrain]<br />\r\nMais laisse-moi, j&#39;peux tout t&#39;expliquer<br />\r\nDes fois j&#39;fais des choses que j&#39;comprends pas<br />\r\n<a annotation-fragment=\"1784885\" classification=\"accepted\" data-id=\"1784885\" href=\"https://genius.com/Maitre-gims-changer-lyrics#note-1784885\" image=\"false\" ng-class=\"{          \'referent--linked_to_preview\': song_ctrl.referent_has_preview(fragment_id),          \'referent--linked_to_preview_active\': song_ctrl.highlight_preview_referent(fragment_element_id),          \'referent--purple_indicator\': song_ctrl.show_preview_referent_indicator(fragment_element_id)        }\" ng-click=\"open()\" on-hover-with-no-digest=\"set_current_hover_and_digest(hover ? fragment_id : undefined)\" pending-editorial-actions-count=\"1\" possibly-branded=\"false\" prevent-default-click=\"\">La nuit m&#39;aide &agrave; m&eacute;diter</a><br />\r\n<a annotation-fragment=\"1788054\" classification=\"accepted\" data-id=\"1788054\" href=\"https://genius.com/Maitre-gims-changer-lyrics#note-1788054\" image=\"false\" ng-class=\"{          \'referent--linked_to_preview\': song_ctrl.referent_has_preview(fragment_id),          \'referent--linked_to_preview_active\': song_ctrl.highlight_preview_referent(fragment_element_id),          \'referent--purple_indicator\': song_ctrl.show_preview_referent_indicator(fragment_element_id)        }\" ng-click=\"open()\" on-hover-with-no-digest=\"set_current_hover_and_digest(hover ? fragment_id : undefined)\" pending-editorial-actions-count=\"0\" possibly-branded=\"false\" prevent-default-click=\"\">C&#39;est dans ces moments que j&#39;me dis que j&#39;vais changer<br />\r\nJ&#39;vais changer</a></p>\r\n\r\n<p><br />\r\n[Couplet 3]<br />\r\n<a annotation-fragment=\"1819441\" classification=\"accepted\" data-id=\"1819441\" href=\"https://genius.com/Maitre-gims-changer-lyrics#note-1819441\" image=\"false\" ng-class=\"{          \'referent--linked_to_preview\': song_ctrl.referent_has_preview(fragment_id),          \'referent--linked_to_preview_active\': song_ctrl.highlight_preview_referent(fragment_element_id),          \'referent--purple_indicator\': song_ctrl.show_preview_referent_indicator(fragment_element_id)        }\" ng-click=\"open()\" on-hover-with-no-digest=\"set_current_hover_and_digest(hover ? fragment_id : undefined)\" pending-editorial-actions-count=\"0\" possibly-branded=\"false\" prevent-default-click=\"\">Assis dans le noir<br />\r\nOccup&eacute; &agrave; compter mes d&eacute;fauts<br />\r\nAu fin fond du couloir</a><br />\r\n<a annotation-fragment=\"1782047\" classification=\"accepted\" data-id=\"1782047\" href=\"https://genius.com/Maitre-gims-changer-lyrics#note-1782047\" image=\"false\" ng-class=\"{          \'referent--linked_to_preview\': song_ctrl.referent_has_preview(fragment_id),          \'referent--linked_to_preview_active\': song_ctrl.highlight_preview_referent(fragment_element_id),          \'referent--purple_indicator\': song_ctrl.show_preview_referent_indicator(fragment_element_id)        }\" ng-click=\"open()\" on-hover-with-no-digest=\"set_current_hover_and_digest(hover ? fragment_id : undefined)\" pending-editorial-actions-count=\"0\" possibly-branded=\"false\" prevent-default-click=\"\">Accroch&eacute; &agrave; un atome d&#39;espoir</a><br />\r\n<a annotation-fragment=\"1819441\" classification=\"accepted\" data-id=\"1819441\" href=\"https://genius.com/Maitre-gims-changer-lyrics#note-1819441\" image=\"false\" ng-class=\"{          \'referent--linked_to_preview\': song_ctrl.referent_has_preview(fragment_id),          \'referent--linked_to_preview_active\': song_ctrl.highlight_preview_referent(fragment_element_id),          \'referent--purple_indicator\': song_ctrl.show_preview_referent_indicator(fragment_element_id)        }\" ng-click=\"open()\" on-hover-with-no-digest=\"set_current_hover_and_digest(hover ? fragment_id : undefined)\" pending-editorial-actions-count=\"0\" possibly-branded=\"false\" prevent-default-click=\"\">Assis dans le noir<br />\r\nOccup&eacute; &agrave; compter mes d&eacute;faut