(10,	130,	'Projects',	'<p>How do you plan on introducing the project approach to your teachers? Do you have any provocation ideas so far? Please share your thoughts!</p>',	'2016-10-19 06:55:00',	'2016-10-20 21:48:18'),
(12,	79,	'byw 2',	'<div class=\"medium-insert-embeds medium-insert-embeds-input medium-insert-embeds-active\"><p>https://www.youtube.com/watch?v=qVMW_1aZXRk<br></p></div><p><br></p>',	'2016-10-19 19:21:16',	'2016-10-19 19:21:16'),
(14,	130,	'Ramps',	'<p>https://www.youtube.com/watch?v=ReaIZFxiy4I<br></p>',	'2016-10-20 21:54:40',	'2016-10-20 21:54:40'),
(23,	1,	'Effective Questioning',	'<p>Hi all !&nbsp;</p><p>Below is the link to an article on effective questioning in the classroom. After reading it, consider the following questions: </p><p><b>How has this shifted your view of how teachers ask questions? What are good questions for teachers to ask?</b></p><p>Please share your thoughts in a comment under this post!</p><p class=\"\"><a href=\"http://exs.exploratorium.edu/wp-content/uploads/2011/05/The-Right-Question-at-the-Right-Time.pdf\">http://exs.exploratorium.edu/wp-content/uploads/2011/05/The-Right-Question-at-the-Right-Time.pdf</a><br></p>',	'2016-11-11 01:23:13',	'2016-11-11 01:23:13'),
(24,	1,	'Questions in the classroom',	'<p class=\"\">Hi everyone!</p><p class=\"\">Thanks for a great DL session last week.&nbsp;</p><p class=\"\">To prepare for our upcoming in-person PD and to continue to think about questioning, go into your classrooms and look for the following:</p><p class=\"\">1) What questions are your teachers asking? How are children responding to them?&nbsp;</p><p class=\"\">2) What are children interested in?</p><p class=\"\"><br></p><p class=\"\">Provide examples for each of these items as a response to this post. If you have a video to accompany a response please upload it via the video center.</p>',	'2016-12-05 16:17:09',	'2016-12-06 23:03:41'),
