(301,	'English 451 Sect. O; spring 2018 			Prof. K. Freeman Late Romantic Literature 			Office Hrs: T&Th 11–12:30 and by appt. MM 117; T&Th 9:30-10:45		Office: Ashe 412; x3986; email: kfreeman@miami.edu  SYLLABUS  Required Texts:     John Keats, Poetry and Prose',	154,	'2018-02-01 14:29:36',	'2018-02-01 14:30:00',	's8qamtj893',	's8qamtj893',	34,	'https://embed-ssl.wistia.com/deliveries/2e55ea561bfe0d9706123d945814a29a979394f9.jpg',	1,	'English 451 Sect. O; spring 2018 			Prof. K. Freeman\r\nLate Romantic Literature 			Office Hrs: T&Th 11–12:30 and by appt.\r\nMM 117; T&Th 9:30-10:45		Office: Ashe 412; x3986; email: kfreeman@miami.edu\r\n\r\nSYLLABUS\r\n\r\nRequired Texts:     John Keats, Poetry and Prose, ed. Cox (Norton). ISBN 978-0-393-92491-6\r\n(Print)		      Jane Austen, Persuasion (Penguin). ISBN 978-0-14-143968-6\r\n		      Shelley\'s Poetry and Prose ed. Reiman & Powers (Norton). ISBN 0-393-97752-8\r\n		      Mary Shelley, Frankenstein [1818 ed.] (Norton, 2nd ed.). ISBN 978-0-393-92793-1\r\n		      Byron\'s Poetry, ed. Levine (Norton).  ISBN 978-0-393-92560-9\r\n		      Letitia Elizabeth Landon, Selected Writings (Broadview). ISBN 1-55111-135-7\r\nBlackboard (Bb):   Romantic Women Poets: 1770-1838, ed. Ashfield (selections)\r\n		      British Women Poets of the Romantic Era, ed. Feldman (selections)\r\n		      Selected Criticism\r\nRecommended:      British Literature 1780-1830, ed. Mellor & Matlak (Harcourt Brace)\r\n(Print)		      \r\n\r\nWEEK 1:			\r\nT 1/16:  Introduction.  Romanticisms: Gender & Genre in the Second and Third Generations.  \r\nTh 1/18:  Mary Tighe [on Bb, both links]: Written at Scarborough & other Sonnets (pp. 777-9 in \r\n	Feldman; pp. 159-60 in Ashfield). Keats [on Bb & in Norton]: To Solitude (52); To One...In City \r\nPent (54).  *req. forum #1 (Bb disc. Board); post due prior to class: 1 par. on one aspect of Thursday’s reading and/or response to other entries posted to the thread).\r\n\r\nWEEK 2:\r\nT 1/23: Keats: On 1st Looking into Chapman\'s Homer (54); Grasshopper & Cricket (57); I Stood Tip-toe \r\n	(21ff); Sleep & Poetry (58). selected letters (see Bb). \r\nTh 1/25: Keats: On Sitting Down... (114); Endymion Preface (147) & *light read excerpts*: Bk I, ll. 1-24 \r\n(148-9); Bk IV, l1. 1-35 (217); & 11. 429 to end (227-39); Isabella; or, the Pot of Basil (429ff).  *req. forum #2 post due prior to class (see details above).\r\n\r\nWEEK 3:		\r\nT 1/30:  Keats: Hyperion (475ff) *Paper #1 due (Tighe OR Keats; 2 pp; details on Paper Topics doc).\r\nTh 2/1: Keats: Eve of St. Agnes (445ff); Bright Star (337); *req. forum #3: Belle Dame (small groups; \r\n	assigned facilitators NOT required to post).  *Opt journal 1 due.\r\n\r\nWEEK 4:\r\nT 2/6: Tighe: Psyche (excerpts, Bb: pp. 160-68 [Ashfield]); Keats: Ode to Psyche (463ff).\r\nTh 2/8: Keats: Ode to a Nightingale (456ff); Fall of Hyperion (excerpt: 497ff, Canto I,  ll. 1-215 only).\r\n\r\nWEEK 5:\r\nT 2/13: Keats: Fall of H, ct; To Autumn (472-3). \r\nTh 2/15: *MIDTERM EXAM: KEATS & TIGHE.  \r\n\r\nWEEK 6:\r\nT 2/20: Persuasion: V. I, Chs 1-9. [*bracketed chapters below refer to eds without vol divisions].\r\nTh 2/22: Persuasion: V. I, 10-12; V. II Chs 1-6 [*chs 13-18]. \r\n\r\nWEEK 7:\r\nT 2/27: Persuasion: V. II, Chs. 7-10 [*Chs. 19-22]; Chs 11 & 12 [*Chs. 23 & 24]. Opt journal 2 due.\r\nTh 2/29:*req. forum #4: Persuasion, 23&24 (small groups; facilitators NOT required to post).\r\n\r\nWEEK 8:\r\nT 3/6: P. B. Shelley: Queen Mab (Cantos V-VII, pp. 42ff); Alastor (72 [Pref & Poem]); On Love (503); \r\n	Defence of Poetry (510).\r\nTh 3/8: P. B. S: Mont Blanc (97); Julian & Maddalo (120). \r\n	Ode to the West Wind (298); Mask of Anarchy (316ff). *Paper #2 Thesis St. due (email).\r\n	\r\nSPRING BREAK (no classes 3/13, 3/15)\r\n\r\nWEEK 9:\r\nT 3/20: P. B. S: Prometheus Unbound: Preface & Act I (206ff).  \r\nTh 3/12: P. B. S: PU II. \r\nP. B. S:  PU III & IV (excerpts only, tba). *Paper #2 Due (P.B. Shelley or Austen; 4-6 pp).\r\n\r\nWEEK 10:\r\nT 3/27: P. B. S:  The Cenci: Dedication, Preface, Act I-II (140ff).  \r\nTh 3/29: P. B. S:  Cenci III-V; *req. forum #5: Cenci V (groups); Adonais (409ff). \r\n\r\nWEEK 11:\r\nT 4/3:  Mary Shelley: Frankenstein [1818 ed.] Vol I (Norton, pp. 7-60); 1831 Intro (Norton, 165-69).\r\nTh 4/5: Frankenstein Vol. II (pp.  61-105). Opt. journal 3 due.\r\n \r\nWEEK 12:\r\nT 4/10:  Frankenstein V III (pp. 107-61). *req. forum #6: Frankenstein III (small groups).\r\nTh 4/12: Byron: Prometheus (239); Childe Harold\'s Pilgrimage: Canto 1 (23ff) & Canto 3 (196ff).\r\n\r\nWEEK 13:\r\nT 4/17: Childe Harold Canto 4 (excerpts, 295ff); Don Juan: Dedication & Canto I (380ff).  \r\nTh 4/19: Felicia Hemans: Indian Woman’s Death Song (Bb, p. 188); Maria Jane Jewsbury: The Glory \r\n	of the Heights (Bb, p. 200); *Thesis Statement for Paper #3 due (email on or before).\r\n\r\nWEEK 14:\r\nT 4/24: Landon: Portrait of Lord Byron (258); Felicia Hemans (250). *req. forum #7: DJ, Canto I \r\n	(groups).\r\nTh 4/26: Landon: St. George’s Hospital (Bb); St. G’s Hosp; 3 extracts from the Diary of a Week (197ff); \r\n	course review.  * Paper #3 Due (Frankenstein, Byron, or Women Poets; 6-8pp)\r\n\r\n*Final Exam: 	TAKE HOME; to be submitted by email (due date and further details tba). \r\n\r\n(Course Requirements, See pp. 3-4) \r\n\r\nCourse Requirements\r\n\r\n(Each student enrolled in the course is expected to comply with these requirements in order to receive credit for the course).\r\n\r\n1. Attendance: required, text & supporting materials in hand.  \r\n\r\na)	More than THREE absences will affect your final grade; with more than EIGHT absences you will lose credit for the course (without a Dean’s excuse for medical emergency).  \r\n\r\nb) Full preparation for discussion is required; unannounced in-class assignments may be given if necessary. If you have been absent, get the assignment before returning to class.  \r\n\r\nc) Check Blackboard (Bb) regularly for announcements, assignments, syllabus updates, and paper topics; bring assigned documents to class.\r\n\r\nd) Electronic devices must be turned off and put away during class unless they are being used for primary texts or Blackboard materials being discussed.  Otherwise, all Bb docs need to be printed and brought to class when indicated.  If the use of devices is distracting to others, they will no longer be allowed.\r\n\r\ne) TEXTS: Editions may be substituted, though these have been selected because of the usefulness of their notations and supporting material.  Please note that in the case of Frankenstein, yours must be the 1818 rather than the 1831 edition.  I discourage most electronic versions of texts as they don’t have the editorial information you will be expected to read along with the texts themselves.   See me if any questions re. substitutions.  If you are using an unnotated electronic edition you are responsible for looking up any unfamiliar terms; the benefit of the print texts that are chosen is that they are the best researched editions available.  Please note that I’ve included ISBN #s above for your convenience.\r\n\r\n2.  Formal Papers:\r\n\r\na) All must be typed and double-spaced throughout.  Follow MLA Handbook for matters of form.  \r\n\r\nb) Papers, submitted electronically, are due before the beginning of class on the due date. Five points per day are deducted for lateness, including weekends and the day it is due.  \r\n\r\nc) Only students who have made A’s - B+’s in previous 400-level literature courses may consult secondary sources.  All students are expected to be fully familiar with rules for citation of sources and the penalties for plagiarism (sources include other student papers, lecture notes from other classes, internet sources, and editor’s notes in addition to published articles and books). To protect you from such charges, you are required to keep earlier drafts and notes of the papers until the graded paper is returned to you.  I do encourage students planning to apply to graduate programs in literature to include secondary sources by the third paper, however. See me well in advance of paper deadlines if you need clarification or wish to use secondary sources. \r\n\r\nd) Papers will be evaluated on the following criteria: careful preparation based on close reading of the text(s); focused, logically organized structure; significant development of the points you raise; focused thesis (generated through your close reading); proficiency in fundamental writing skills. \r\n*You are responsible for material covered in the prerequisite composition courses regarding usage and essay construction.  If you are weak in these areas, you must take a draft of your paper to the Writing Center well before the due date.  \r\n\r\ne) Drafts are welcome no later than 3 days before the due date.  Revisions are not accepted once the paper is graded.  I will not proofread; we will discuss revisions towards a more coherent argument.  \r\n\r\nf) You will be given suggested paper topics, which will include relevant works to discuss. You may not write on short works or sections of longer works covered in detail in class.  You are encouraged to generate your own topic that should be approved well in advance of the due date. \r\n\r\n3. Participation: \r\n\r\na. For the first several weeks of the semester, you are required to email a written response re. only one assigned text (or part of a text) for each class, due before class.  This response may be as brief as a paragraph and may be posed as a question with a suggested answer.  Though these responses will not be graded, they will be included in the evaluation of your overall course participation.\r\n\r\nb. Your engagement in discussion is encouraged.  Please respect the interpretations of your colleagues even when they differ from your own, central to any engagement in an academic community.\r\n\r\nc. Each student will facilitate a small, informal discussion group once during the semester, requiring no research; *non-facilitating students will be required to post responses on Bb for facilitators to use in preparing their discussions; the objective is to bring your own observations and questions to the group as a means of generating and sustaining discussion for approximately ten minutes followed by a report to the full class about the group’s concerns.\r\n \r\nd. Optional Journal: For extra credit, a minimum of one typed pg per class is required.  Although the entries are to be written before each class in the three-week cycle, the group of entries will be submitted together, via email if computer-generated (See syll for dates; you may opt in or out in 3 wk cycles depending on your workload).  You may write on any of the works assigned for each class, but you must write it BEFORE the class even though it will not be collected immediately.  The journal is an excellent way to hone ideas for papers, for exam review, and to help you participate in class discussion. \r\n\r\n4. Exams: \r\nIn-class midterm and take-home final exam. \r\n\r\n5. Office hours:  \r\nYou are welcome to come in for a conference during the times above without appt.  If you are not available during office hours, please make an appt, preferably via email.\r\n',	0),
