(304,	'',	154,	'2018-02-02 08:22:33',	'2018-02-02 08:38:11',	'5ktwuwot6o',	'5ktwuwot6o',	34,	'https://embed-ssl.wistia.com/deliveries/cf72cbf39c85382e26d477f7862aaadf508e5c75.jpg',	1,	'<p>William Shakespeare (/ˈʃeɪkspɪər/; 26 April 1564 (baptised) &ndash; 23 April 1616)[a] was an English poet, playwright and actor, widely regarded as the greatest writer in the English language and the world&#39;s pre-eminent dramatist.[2][3][4] He is often called England&#39;s national poet and the &quot;Bard of Avon&quot;.[5][b] His extant works, including collaborations, consist of approximately 39 plays,[c] 154 sonnets, two long narrative poems and a few other verses, some of uncertain authorship. His plays have been translated into every major living language and are performed more often than those of any other playwright.[7] Shakespeare was born and brought up in Stratford-upon-Avon, Warwickshire. At the age of 18, he married Anne Hathaway, with whom he had three children: Susanna and twins Hamnet and Judith. Some time between 1585 and 1592, he began a successful career in London as an actor, writer, and part-owner of a playing company called the Lord Chamberlain&#39;s Men, later known as the King&#39;s Men. At age 49 around 1613, he appears to have retired to Stratford, where he died three years later. Few records of Shakespeare&#39;s private life survive, which has stimulated considerable speculation about such matters as his physical appearance, sexuality, religious beliefs and whether the works attributed to him were written by others.[8][9][10] These speculations are often criticized for failing to point out the fact that few records survive of most commoners of his period. Shakespeare produced most of his known work between 1589 and 1613.[11][12][d] His early plays were primarily comedies and histories, which are regarded as some of the best work ever produced in these genres. He then wrote mainly tragedies until about 1608, including Hamlet, Othello, King Lear and Macbeth, considered some of the finest works in the English language.[2][3][4] In his last phase, he wrote tragicomedies, also known as romances and collaborated with other playwrights. Many of his plays were published in editions of varying quality and accuracy during his lifetime. However, in 1623 John Heminges and Henry Condell, two friends and fellow actors of Shakespeare, published a more definitive text known as the First Folio, a posthumous collected edition of his dramatic works that included all but two of the plays now recognised as Shakespeare&#39;s.[13] It was prefaced with a poem by Ben Jonson, in which Shakespeare is hailed, presciently, as &quot;not of an age, but for all time&quot;.[13] In the 20th and 21st centuries, his works have been repeatedly adapted and rediscovered by new movements in scholarship and performance. His plays remain highly popular and are constantly studied, performed, and reinterpreted in diverse cultural and political contexts throughout the world. Contents [hide] 1 Life 1.1 Early life 1.2 London and theatrical career 1.3 Later years and death 2 Plays 2.1 Performances 2.2 Textual sources 3 Poems 3.1 Sonnets 4 Style 5 Influence 6 Critical reputation 7 Works 7.1 Classification of the plays 8 Speculation about Shakespeare 8.1 Authorship 8.2 Religion 8.3 Sexuality 8.4 Portraiture 9 See also 10 Notes and references 10.1 Notes 10.2 References 11 Sources 12 External links</p>',	0),
